import React from 'react'
import {Route} from 'react-router-dom';
import Home from './components/Home';
import Login from './components/Login';
import Signup from './components/Signup';
import Navbar from "./components/Navbar";

export const App = () => {
  return (
    <>
      <Navbar/>
      <Route>
         <Home/>
      </Route>

      <Route>
         <Profile/>
      </Route>

      <Route>
         <Login/>
      </Route>

      <Route>
         <Signup/>
      </Route>

    </>
  )
}

export default App;
